type ImageTypes = 'png' | 'jpeg' | 'jpg';
type Base64<imageType extends ImageTypes> =
  `data:image/${imageType};base64${string}`;

function base64ToArrayBuffer(base64img) {
  const buffer = new Uint8Array(Buffer.from(base64img, 'base64'));

  return buffer;
}

const labradorImage: Base64<'jpeg'> = `data:image/jpeg;base64,`;
const imageAsByteArray: Uint8Array = base64ToArrayBuffer(labradorImage);

export { imageAsByteArray, labradorImage };
